script: |
  super -f text -I q8949.spq | sort > q8949.out

inputs:
  - name: q8949.spq
    data: |
      SELECT - 7 + - - col0 + + + ( - + ( - - col0 ) ) AS col0, ( ( - col0 ) ) * - col0 / col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q8949.out
    data: |
      -7	51
      -7	85
      -7	91
